import React, { useState, useEffect } from 'react';
import { 
  BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, 
  PieChart, Pie, Cell, 
  ResponsiveContainer 
} from 'recharts';
import './App.css';

function ExploratoryDataAnalysisPage() {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [dataOverview, setDataOverview] = useState(null);

  // Visualization data
  const targetDistributionData = [
    { name: 'Approved', value: 3750, color: '#4CAF50' },
    { name: 'Rejected', value: 1250, color: '#F44336' }
  ];

  const featureDistributionData = [
    { feature: 'Age', average: 40, min: 25, max: 60 },
    { feature: 'Income', average: 75000, min: 30000, max: 150000 },
    { feature: 'Experience', average: 10, min: 1, max: 25 }
  ];

  useEffect(() => {
    const timer = setTimeout(() => {
      setDataOverview({
        total_records: 5000,
        features: 12,
        target_distribution: {
          approved: 3750,
          rejected: 1250
        },
        missing_values: "None",
        data_types: {
          numerical: ["Age", "Experience", "Income", "ZIP Code", "Family", "CCAvg", "Mortgage"],
          categorical: ["Education", "Securities Account", "CD Account", "Online", "CreditCard"]
        }
      });
      setLoading(false);
    }, 1000);

    return () => clearTimeout(timer);
  }, []);

  if (loading) {
    return (
      <div className="page-container">
        <h1>Exploratory Data Analysis</h1>
        <div className="loading-indicator">Loading data analysis...</div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="page-container">
        <h1>Exploratory Data Analysis</h1>
        <div className="error-message">Error loading data: {error}</div>
      </div>
    );
  }

  return (
    <div className="page-container">
      <h1>Exploratory Data Analysis</h1>
      
      <div className="eda-container">
        {/* Existing Dataset Overview section */}
        <section className="eda-section">
          <h2>Dataset Overview</h2>
          <div className="data-card-container">
            <div className="data-card">
              <div className="data-card-title">Total Records</div>
              <div className="data-card-value">{dataOverview.total_records}</div>
            </div>
            <div className="data-card">
              <div className="data-card-title">Features</div>
              <div className="data-card-value">{dataOverview.features}</div>
            </div>
          </div>
        </section>
        
        {/* Data Visualizations Section */}
        <section className="eda-section">
          <h2>Data Visualizations</h2>
          <div className="visualizations-container">
            {/* Target Distribution Pie Chart */}
            <div className="visualization-card">
              <h3>Loan Approval Distribution</h3>
              <ResponsiveContainer width="100%" height={300}>
                <PieChart>
                  <Pie
                    data={targetDistributionData}
                    cx="50%"
                    cy="50%"
                    labelLine={false}
                    outerRadius={80}
                    dataKey="value"
                    label={({ name, percent }) => `${name} ${(percent * 100).toFixed(0)}%`}
                  >
                    {targetDistributionData.map((entry) => (
                      <Cell key={entry.name} fill={entry.color} />
                    ))}
                  </Pie>
                  <Tooltip />
                  <Legend />
                </PieChart>
              </ResponsiveContainer>
            </div>

            {/* Feature Distribution Bar Chart */}
            <div className="visualization-card">
              <h3>Feature Distribution</h3>
              <ResponsiveContainer width="100%" height={300}>
                <BarChart data={featureDistributionData}>
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis dataKey="feature" />
                  <YAxis />
                  <Tooltip 
                    formatter={(value, name) => {
                      if (name === 'average') return [`Average: ${value}`, 'Average'];
                      return [value, name];
                    }}
                  />
                  <Legend />
                  <Bar dataKey="average" fill="#8884d8" name="Average Value" />
                </BarChart>
              </ResponsiveContainer>
            </div>
          </div>
        </section>
        
        {/* Feature Types Section */}
        <section className="eda-section">
          <h2>Feature Types</h2>
          <div className="feature-types">
            <div className="feature-type">
              <h3>Numerical Features</h3>
              <ul className="feature-list">
                {dataOverview.data_types.numerical.map((feature, index) => (
                  <li key={index}>{feature}</li>
                ))}
              </ul>
            </div>
            <div className="feature-type">
              <h3>Categorical Features</h3>
              <ul className="feature-list">
                {dataOverview.data_types.categorical.map((feature, index) => (
                  <li key={index}>{feature}</li>
                ))}
              </ul>
            </div>
          </div>
        </section>
      </div>
    </div>
  );
}

export default ExploratoryDataAnalysisPage;
